style.css:
@-moz-document domain("torrentgalaxy.to") {
ul.navbar-nav > li > a:hover, ul.navbar-nav > li > a:active
{
    background-color: #303030;
}
body {
    background-color: #008000;
}
.row {
    margin: 1;
}
a {
    color: #000000;
}
a:hover, a:active {
    color: #08d808;
}
#arcade {
    background-color: #024343;
    box-shadow: 0 0 10px 5px #666666 inset;
}
.thumbnail {
    background-color: #F5F5F5;
}
.thumbnail .caption {
    color: black;
}
.alert-info {
    background-color: #373737 !important;
}
#panelmain {
    color: black;
    background-color: #383838;
}
#panelmain legend {
    color: #F5F5F5;
}
.tgxtablerow:hover, .tgxtablerow:active, .tgxtablerow:nth-of-type(2n+1):hover, .tgxtablerow:nth-of-type(2n+1):active
{
    background-color: #F5F5F5;
}
.tprow, .newtablerow, .tprow:hover {
    background-color: #535050;
}
.tprow:nth-of-type(2n+1), .newtablerow:nth-of-type(2n+1)
{
    background-color: #595959;
}
.ntranimate:hover, .ntranimate:active,
.ntranimate:nth-of-type(2n+1):hover, .ntranimate:nth-of-type(2n+1):active{
    background-color: #5b5b46;
}
.breadcrumb, .form-control, .btn-default,
.pagination > li > a, .pagination > li > span,
.table-striped > tbody > tr:nth-of-type(2n+1),
.likeboxtr,
.panel,
.chattersonline
{
    background-color: #2F4F4F;
    color: #08d808;
}
.chatbox {
    background-color: #505050;
}
#chatcoldd:nth-of-type(2n+1) {
    background-color: rgba(20,20,20,0.75);
}
.chatinputdiv button {
    background-color: #F5F5F5 !important;
}
#bbinput {
    background-color: #222222 !important;
    color: #F5F5F5 !important;
}
.chattersonline > .namebadge {
    border: black;
    box-shadow: none;
    background: none;
}
#intblock {
    border-color: black;
}
#intblockheader
{
    border-color: black;
    background-color: #000000;
}
#innerhead {
    background-color: #696969;
    color: #000000;
}
.tgxtablerow {
    background-color: #333333;
}
.tgxtablerow:nth-of-type(2n+1) {
    background-color: #222222;
}
.tgxtablerow a {
    color: #08d808;
}
#smallnav[href="/account.php"] {
    background-color: transparent !important;
    color: #696969 !important;
}
#ddnews:nth-of-type(2n+1) {
    background-color: #2b2727;
}
textarea#ghosted.mail,
textarea.mail,
#ddnews
{
    background-color: #242424;
    color: #F5F5F5;
}
#headnew {
    background: radial-gradient(ellipse at center,#272a16 5%,#121212 50%);
}
img.profile {
    border-color: #000000;
}
.well {
    background-color: #242424;
    color: #F5F5F5;
}
.pagination > .disabled > a, .pagination > .disabled > a:focus, .pagination > .disabled > a:hover, .pagination > .disabled > span, .pagination > .disabled > span:focus, .pagination > .disabled > span:hover {
    background-color: #222222
}
.pagination > .active > a, .pagination > .active > a:focus, .pagination > .active > a:hover, .pagination > .active > span, .pagination > .active > span:focus, .pagination > .active > span:hover {
    background-color: #032848;
    border-color: #032848;
}
th.forumhead {
    background-color: #0e0e0e;
}
tr.subforumhead {
    background-color: #333333 !important;
}
.clickable-row:hover, .clickable-row:active {
    background-color: rgba(245,245,245,1) !important;
}
.subforumhead:hover, .subforumhead:active {
    background-color: #333333 !important;
}
#inthpheader {
    background-color: #000000;
}
.select select {
  background-color: #e6e6e6;
  color: #7b7b7b;
}
.select select:hover, .select select:active, .select select:focus {
  color: #000000;
  background: #ccc;
}
.btn-success {
    background-color: #058305;
    border-color: #058305;
}
.btn-success:hover, .btn-success:active, .btn-success:focus {
    background-color: #000066;
    border-color: #000066;
}
a.btn.ddbutton {
	display: block;
}
a.btn.ddbutton {
	margin: 6px 8px 0px 8px;
}
.buttonbox {
	background-color: #212121;
	color: #bdbdbd;
}
.btn.btn-dark:hover  {
	background-color: green;
}
.btn.btn-success:hover {
	background-color: #4e9e00;
}
.btn.btn-primary:hover {
	background-color: #124d67;
	border-color: #124d67;
}
.btn.btn-default:hover {
	background-color: #847ca561;
}
.btn-default:hover, .btn-default:active,
.pagination > li > a:hover, .pagination > li > span:hover,
.pagination > li > a:active, .pagination > li > span:active {
    background-color: #303030;
    color: #AC8D8D;
}
#filterbox, #filterbox2 {
    background-color: #404040;
}
form[name="upload"] .input-group > input {
    background-color: #404040;
    color: #004d4d;
}
.namebadge {
    background: none;
    background-color: #404040;
    border-color: #000;
}
.namebadge:hover, .namebadge:active, .namebadge:focus
{
    background: none;
    background-color: #F5F5F5;
    border-color: #000;
}
.panel-primary > .panel-heading {
    border-bottom: none;

}
}
